import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Link, useLocation } from 'react-router-dom';
import { Sparkles, Menu, X } from 'lucide-react';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const location = useLocation();

  const navStyles = {
    navbar: {
      background: 'rgba(255, 255, 255, 0.1)',
      backdropFilter: 'blur(10px)',
      borderBottom: '1px solid rgba(255, 255, 255, 0.2)',
      position: 'fixed',
      top: 0,
      width: '100%',
      zIndex: 50,
    },
    container: {
      maxWidth: '1200px',
      margin: '0 auto',
      padding: '0 1rem',
    },
    logo: {
      display: 'flex',
      alignItems: 'center',
      gap: '0.5rem',
      textDecoration: 'none',
    },
    gradientText: {
      background: 'linear-gradient(45deg, #667eea, #764ba2, #f093fb)',
      WebkitBackgroundClip: 'text',
      WebkitTextFillColor: 'transparent',
      backgroundClip: 'text',
    },
    navItem: {
      padding: '0.5rem 1rem',
      borderRadius: '0.375rem',
      fontSize: '0.875rem',
      fontWeight: '500',
      textDecoration: 'none',
      transition: 'all 0.3s ease',
    },
    mobileMenu: {
      background: 'rgba(255, 255, 255, 0.1)',
      backdropFilter: 'blur(10px)',
      borderRadius: '0.5rem',
      marginTop: '0.5rem',
    },
  };

  const navItems = [
    { name: 'Home', path: '/' },
    { name: 'Dashboard', path: '/dashboard' },
    { name: 'History', path: '/history' },
    { name: 'Profile', path: '/profile' },
  ];

  return (
    <motion.nav
      initial={{ y: -100 }}
      animate={{ y: 0 }}
      style={navStyles.navbar}
    >
      <div style={navStyles.container}>
        <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', height: '4rem' }}>
          {/* Logo */}
          <motion.div whileHover={{ scale: 1.05 }}>
            <Link to="/" style={navStyles.logo}>
              <Sparkles size={32} color="#d8b4fe" />
              <span style={{ ...navStyles.gradientText, fontSize: '1.25rem', fontWeight: 'bold' }}>
                VeriCreate
              </span>
            </Link>
          </motion.div>

          {/* Desktop Menu */}
          <div style={{ display: 'none', gap: '1rem', alignItems: 'center' }}>
            {navItems.map((item) => (
              <Link
                key={item.name}
                to={item.path}
                style={{
                  ...navStyles.navItem,
                  color: location.pathname === item.path ? '#ffffff' : '#d1d5db',
                  background: location.pathname === item.path ? 'rgba(147, 51, 234, 0.5)' : 'transparent',
                }}
                onMouseEnter={(e) => {
                  if (location.pathname !== item.path) {
                    e.target.style.background = 'rgba(147, 51, 234, 0.2)';
                    e.target.style.color = '#ffffff';
                  }
                }}
                onMouseLeave={(e) => {
                  if (location.pathname !== item.path) {
                    e.target.style.background = 'transparent';
                    e.target.style.color = '#d1d5db';
                  }
                }}
              >
                {item.name}
              </Link>
            ))}
          </div>

          {/* Mobile menu button */}
          <div style={{ display: 'block' }}>
            <button
              onClick={() => setIsOpen(!isOpen)}
              style={{ color: '#d1d5db', background: 'none', border: 'none', cursor: 'pointer' }}
            >
              {isOpen ? <X size={24} /> : <Menu size={24} />}
            </button>
          </div>
        </div>

        {/* Mobile Menu */}
        {isOpen && (
          <motion.div
            initial={{ opacity: 0, scale: 0.95 }}
            animate={{ opacity: 1, scale: 1 }}
            style={navStyles.mobileMenu}
          >
            <div style={{ padding: '0.5rem', display: 'flex', flexDirection: 'column', gap: '0.25rem' }}>
              {navItems.map((item) => (
                <Link
                  key={item.name}
                  to={item.path}
                  onClick={() => setIsOpen(false)}
                  style={{
                    ...navStyles.navItem,
                    display: 'block',
                    color: location.pathname === item.path ? '#ffffff' : '#d1d5db',
                    background: location.pathname === item.path ? 'rgba(147, 51, 234, 0.5)' : 'transparent',
                  }}
                >
                  {item.name}
                </Link>
              ))}
            </div>
          </motion.div>
        )}
      </div>
    </motion.nav>
  );
};

export default Navbar;
